import React from 'react';
import './App.css';

function InfoFirst() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to<i id="titleCompany">A &amp; A Graham Ltd</i>IT Contractors and Website Builders.
        </p>
        <p>
          Scroll Down<br/>
          for more information
        </p>
      </header>
    </div>
  );
}

export default InfoFirst;
